import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Login from "./components/Login"; // make sure the path is correct
import Home from "./components/Home";
import Retrieve from "./components/Retrieve";
import Save from "./components/Save";
import WalletSave from "./components/WalletSave";

function App() {
  return (
    <Router>
      <div className="container">
        {/* Add any common header or navbar components here */}

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<div>TBD</div>} />
          <Route path="/retrieve" element={<Retrieve />} />
          <Route path="/save" element={<Save />} />
          <Route path="/walletsave" element={<WalletSave />} />

          {/* Add other routes here */}
        </Routes>

        {/* Add any common footer components here */}
      </div>
    </Router>
  );
}

export default App;
